import abImg from '../src/images/model1.jpg';

const About = () => {
  return (
    <>
      <section className='about_section'>
        <div className='container-fluid'>
          <div className='row'>
            <div className='about_div col-10 mx-auto'>
              <div className='img_div img-fluid col-4 mx mx-auto'>
                <img src={abImg} alt='abimage' />
              </div>
              <div className='ab_txt col-8 mx-auto'>
                <h1 className='text-capitalize'>About section</h1>
                <p>
                  Lorem ipsum dolor sit amet consectetur adipisicing elit.
                  Reiciendis, a placeat animi explicabo voluptatum adipisci
                  ipsam suscipit numquam? Quam hic doloribus magni corrupti
                  reiciendis sit earum dolores atque consequuntur adipisci.
                </p>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default About;
